package org.example.ibm;

import java.util.stream.Stream;

import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.Arguments;
import org.junit.jupiter.params.provider.MethodSource;

import static org.junit.jupiter.api.Assertions.assertEquals;

class FindTheDifferenceImplTest
{
    @ParameterizedTest
    @MethodSource("provideTestData")
    void test(String s, String t, char expectedResult)
    {
        char actualResult = FindTheDifferenceImpl.findTheDifference(s, t);
        assertEquals(expectedResult, actualResult);
    }

    private static Stream<Arguments> provideTestData()
    {
        return Stream.of(
                Arguments.of("abcd", "abcde", 'e'),
                Arguments.of("abecd", "abecvd", 'v'),
                Arguments.of("", "y", 'y'),
                Arguments.of("", "", 't')
        );
    }

}